import { times } from 'lodash';
var React = require('react');

var Content = () => {
  return(
    <div className='contentContainer'>
      <div className='gameBox'>
        {
          times(3, (row) => {
            console.log(row)
            times(3, (column) => {
              console.log(column);
              return(
                <div key={row+column} className='tile'>
                </div>
              )
            })
          })
        }
      </div>
    </div>
  )
}

export default Content;
